@-moz-document domain("tashed.com") {

body,
.container
{background-image:none !important;
background: #36373b url("data:image/jpeg;base64,") top left repeat !important;
color: #c3cbcc !important}

a{color:#c3cbcc ; text-decoration:none !important}
a:hover{color:#FFFFFF ;text-decoration:none !important}

